package web

import (
	"fmt"
	"io/ioutil"
	"strings"
	"testing"

	"github.com/stretchr/testify/assert"
)

const testHTML = `<p>Test line 1</p>

<p>Test line 2</p>

<p><br>
</p>

<p><img class="image" src="data:image/jpeg;base64,"></p>

<p><br>
</p>

<p>Test line 1</p>

<p><br>
</p>

<p><img class="image2" src="data:image/png;base64,"></p>

<p><br>
</p>`

func TestConvertImage(t *testing.T) {
	html, m, err := CaptureBase64Images(testHTML)
	assert.Nil(t, err)
	assert.Equal(t, 2, len(m))
	assert.Equal(t, false, strings.Contains(html, "base64"))
	for image := range m {
		ioutil.WriteFile(image, m[image], 0644)
	}
	ioutil.WriteFile("new.html", []byte(html), 0644)
}

const testMarkdown = `# this is some testing

![](data:image/jpeg;base64,)

[![](data:image/png;base64,)](link)
`

func TestConvertImageMarkdown(t *testing.T) {
	html, m, err := CaptureBase64ImagesFromMarkdown(testMarkdown)
	fmt.Println(html, m)
	assert.Nil(t, err)
	assert.Equal(t, 2, len(m))
	assert.Equal(t, false, strings.Contains(html, "base64"))
	for image := range m {
		ioutil.WriteFile(image, m[image], 0644)
	}
	ioutil.WriteFile("new.html", []byte(html), 0644)
}
